import React from "react";
import { Router, Switch, Route } from "react-router-dom";

import MastHead from "./MastHead";
import Home from "./Home";
import Fitness from "./Fitness";
import Sports from "./Sports";

import "./App.css";

const App = () => (
  <Router>
    <header></header>
    <MastHead />
    <Switch>
      <Route path="/fitness">
        <Fitness />
      </Route>
      <Route path="/sports">
        <Sports />
      </Route>
      <Route path="/" exact={true}>
        <Home />
      </Route>
    </Switch>
  </Router>
);

export default App;
